import React from 'react';

import './HowItWorks.css';
import Grid from '@material-ui/core/Grid';
const howItWorks = (props) => (
<div>
    <Grid container>
        <Grid item xs={2}></Grid>
<Grid item xs={8}><h2>{props.h2}</h2></Grid>
    </Grid>

    <Grid container className="how1">
        <Grid item xs={2}></Grid>
        <Grid container xs={10}>
        <Grid item xs={6}><img src={props.img1} alt="companies image" /></Grid>
        <Grid item xs={1}></Grid>
        <Grid item xs={5}>{props.text1}</Grid>
        </Grid>
        
    </Grid></div>
  

);

export default howItWorks;
